-- DDL statement for to create the geneLocOMIM, table with genetic locations for genes associated with leukodystrophies
CREATE TABLE geneLocOMIM(
    OMIM_Num INT,
    geneOMIM_Num INT,
    gene VARCHAR(20),
    chromosome VARCHAR(5),
    cytoLocation VARCHAR(15),
    genomicPositionStart INT,
    genomicPositionEnd INT, 

    PRIMARY KEY (geneOMIM_Num, gene, cytoLocation)
);

-- DDL statement for to create the geneNamesOMIM, table with alternative names for the genes associated with leukodystrophies
CREATE TABLE geneNamesOMIM( 
    OMIM_Num INT,
    geneOMIM_Num INT,
    gene VARCHAR(20),
    geneName VARCHAR(75),
    approvedGeneSymbol VARCHAR(20),
    entrezGeneID INT,
    ensemblGeneID VARCHAR(25),

    PRIMARY KEY (geneOMIM_Num, gene)
 );

-- DDL statement for to create the gene_phenoOMIM, table with phenotype, inheritance type, and associated gene for leukodystrophies
CREATE TABLE gene_phenoOMIM( 
    OMIM_Num INT,
    geneOMIM_Num INT,
    geneName VARCHAR(75),
    phenotype VARCHAR(125),
    phenNum INT,
    inhertType VARCHAR(25),

    PRIMARY KEY (geneOMIM_Num, phenotype)
);

-- DDL statement for to create the phenMapRef, which has phenoNum from OMIM and what it means in the gene map 
CREATE TABLE phenMapRef( 
    phenNum INT,
    phenMapFull VARCHAR(125),

    PRIMARY KEY (phenNum)
);




